import React from 'react'
import Post from './Post'
import Share from './Share'
import { Posts } from '../dummyData'

const Feed = () => {
  return (
  <div className='w-3/5 flex flex-col overflow-y-scroll'>
        <Share/>
        {Posts.map(p => 
          <Post key={p.id} post={p}/>
        )}

  </div>
  )
}

export default Feed
